import { useCallback } from "react";
import "./SubscriptionContainer.css";

const SubscriptionContainer = () => {
  const onButtonContainer4Click = useCallback(() => {
    window.open(
      "https://www.animaapp.com/?utm_source=figma-samples&utm_campaign=figma-nftmarket&utm_medium=figma-samples"
    );
  }, []);

  return (
    <div className="subscribe-widget4">
      <div className="subscribe-widget5">
        <img className="photo-icon18" alt="" src="/photo@2x.png" />
        <div className="headline-subhead-container">
          <div className="headline-subhead28">
            <div className="join-our-weekly2">Join our weekly digest</div>
            <div className="get-exclusive-promotions2">{`Get exclusive promotions & updates straight to your inbox.`}</div>
          </div>
          <div className="subscribe-form">
            <div className="enter-your-email2">Enter your email here</div>
            <div className="button54" onClick={onButtonContainer4Click}>
              <img
                className="envelopesimple-icon5"
                alt=""
                src="/envelopesimple.svg"
              />
              <div className="button55">Subscribe</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SubscriptionContainer;
